Hello my Angles ! 👋🏻
After a really great research and Trial & Error I have finally found my favourite foundation and I’ve been obsessed with it since past 3-4 years now !! 
It’s non other than @esteelauderin @esteelauder Double Wear Foundation and I am in shade Shell Beige !! 
This is so literally Long Lasting, True Match for the skin and also doesn’t dry or flake out even if you’re wearing it for more than 8hrs !! 💯💯
I almost use it on most of my brides and even on myself if I need my makeup to last for all day long !! 💓
